script: |
  super -f text -I q1771.spq | sort > q1771.out

inputs:
  - name: q1771.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE 2 NOT IN ( - 52, - col0 * - - 96 * 11 + - col1 * 69 );
  - name: tab1

outputs:
  - name: q1771.out
    data: |
      51	14	96
      85	5	59
      91	47	68
